import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./pages/home";
import DetailMeal from "./pages/DetailMeal/index"; // Asegúrate de que la ruta sea correcta

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/meal/:idMeal" component={DetailMeal} /> {/* Ruta para el detalle */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
